import React from 'react';
import { Box, Typography, Button, Grid, Card, CardMedia, CardContent } from '@mui/material';
import { Link } from 'react-router-dom';

const Home = () => {
  const services = [
    {
      id: 1,
      name: 'Veg Thali',
      image: 'https://via.placeholder.com/300',
      description: 'A wholesome meal packed with nutrition.',
    },
    {
      id: 2,
      name: 'Non-Veg Thali',
      image: 'https://via.placeholder.com/300',
      description: 'Delicious non-veg dishes for food lovers.',
    },
  ];

  return (
    <Box sx={{ textAlign: 'center', padding: '2rem', backgroundColor: '#f9f9f9' }}>
      {/* Welcome Section */}
      <Box sx={{ padding: '2rem', backgroundColor: '#fff', borderRadius: '8px', marginBottom: '2rem' }}>
        <Typography variant="h3" gutterBottom>
          Welcome to Tiffin Service
        </Typography>
        <Typography variant="h6" color="text.secondary" gutterBottom>
          Your daily meal partner for healthy and delicious food.
        </Typography>
        <Button
          variant="contained"
          color="primary"
          size="large"
          component={Link}
          to="/subscription"
          sx={{ marginTop: '1rem' }}
        >
          Subscribe Now
        </Button>
      </Box>

      {/* Services Section */}
      <Typography variant="h4" gutterBottom>
        Our Services
      </Typography>
      <Grid container spacing={4} justifyContent="center">
        {services.map((service) => (
          <Grid item xs={12} sm={6} md={4} key={service.id}>
            <Card>
              <CardMedia
                component="img"
                height="200"
                image={service.image}
                alt={service.name}
              />
              <CardContent>
                <Typography variant="h6">{service.name}</Typography>
                <Typography variant="body2" color="text.secondary">
                  {service.description}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* Call to Action */}
      <Box sx={{ marginTop: '2rem' }}>
        <Typography variant="h5" gutterBottom>
          Ready to start your healthy meal journey?
        </Typography>
        <Button
          variant="contained"
          color="success"
          size="large"
          component={Link}
          to="/login"
        >
          Get Started
        </Button>
      </Box>
    </Box>
  );
};

export default Home;
